                <th>DomicilioNumero</th>
                <th>Telefono</th>
                <th>Ingreso</th>
                <th>Localidad</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for paciente in pacientes %}
            <tr>
                <td>{{ paciente.id }}</td>
                <td>{{ paciente.Apellido }}</td>
                <td>{{ paciente.Nombre }}</td>
                <td>{{ paciente.DomicilioCalle }}</td>
                <td>{{ paciente.DomicilioNumero }}</td>
                <td>{{ paciente.Telefono }}</td>
                <td>{{ paciente.Ingreso ? paciente.Ingreso|date('Y-m-d') : '' }}</td>
                <td>{{ paciente.Localidad }}</td>
                <td>
                    <a href=\"{{ path('app_paciente_show', {'id': paciente.id}) }}\">show</a>
                    <a href=\"{{ path('app_paciente_edit', {'id': paciente.id}) }}\">edit</a>
